import React from "react";

const IMAGE_URL = "https://image.tmdb.org/t/p/w500";

const VideoListItem = ({ movie }) => {
  return (
    <li className="list-group-item">

      <img
        height="200px"
        width="200px"
        src={`${IMAGE_URL}${movie.poster_path}`}
        alt="film"
      />
      <h3>{movie.title}</h3>
    </li>
  );
};

export default VideoListItem;
